import React, {useState} from "react";



function Solution(){

    const[inputs, setInputs]= useState(false);
    const[variable, setVariable]= useState(false);

    function handleChangeNumberOfInputs(event){
        let value= event.target.value;
        setInputs(value);
    }

    function getInputs(){
        
        setVariable(true);

    }

    return(
        <div>
            <div className="container form" style={{marginTop: "20px"}}>
            
                <div className= "row">

                    <div className= "col-lg-6">
                        <input
                            type="number"
                            placeholder= "Number of Nodes"
                            onChange= {e =>{handleChangeNumberOfInputs(e)}}
                        >
                        </input>

                        <button className= "btn btn-primary getInputs" onClick= {getInputs()}>Insert data</button>

                        
                            {variable ? <h1>Hey</h1> : null}
                        
                    </div>
                        
                </div>
            </div>
        </div>        
        

    )
}


export default Solution;
